`,r:{minutes:.06,words:18},y:"a",t:"番剧",i:"discover"},["/shares/bangumis/index.html","/shares/bangumis/README.md"]],["v-f11f4898","/shares/bangumis/%E7%95%AA%E5%89%A7%E6%8E%A8%E8%8D%90.html",{a:"nikola",d:16687296e5,l:"November 18, 2022",c:["番剧"],g:["番剧"],u:!1,o:!0,e:`<table>
<thead>
<tr>
